import React, { Component } from 'react'

export default class Onlybtn extends Component {
    render() {
        return (
            <div>
                <div className=" text-center">
                    <button className=" my-5 combo-last-btn ">View All Packages</button>
                </div>

            </div>
        )
    }
}
